INSERT INTO `tips` VALUES
(1,'update da invoiceins','INSERT INTO invoices (\r\n    fornitore_piva,\r\n    fornitore,\r\n    invoice_number,\r\n    invoice_date,\r\n    total_amount,\r\n    tax_amount,\r\n    coge\r\n)\r\nSELECT\r\n    i.partita_iva,\r\n    i.nome_fornitore,\r\n    i.nr_documento,\r\n    i.data_ricezione_fatt,\r\n    i.importo_totale_fornitore,\r\n    i.importo_iva,\r\n    i.nr_cliente_fornitore\r\n from invoiceins i\r\ninner join fornitoris f on f.coge = i.nr_cliente_fornitore');
